import React, {useEffect, useRef} from 'react';
import styles from './Swap.module.css';
import ButtonComponent from './button';
import RubLogo from './rub.svg';
import RmbLogo from './rmb.svg';
import UsdtLogo from './usdt.svg'

// Установим фиксированный курс RMB к RUB
const RMB_TO_RUB_RATE = 14.11;

// Функция для конвертации RMB в RUB
function convertRMBtoRUB(amountInRMB) {
    return amountInRMB * RMB_TO_RUB_RATE;
}

function Swap() {
    let from = useRef(0.0)
    let to = useRef(0.0)
    useEffect(() => {
        if(!from.current.value || !to.current.value) {
            from.current.value = 0.0;
            to.current.value = 0.0;
        }
    }, []);
    return (
        <div className={styles.swap}>
            <div className={styles.currencyPair}>
                <div className={styles.currencyPairItem}>
                    <h3>From</h3>
                    <div className={styles.swapInput}>
                        <div className={styles.swapInputLeft}>
                            <input ref={from} onInput={() => {
                                to.current.value = (from.current.value * 13.85).toFixed(2)
                            }}/>
                        </div>
                        <div className={styles.swapInputRight}>
                            <div className={styles.swapInputPlaceholder}>~RUB</div>
                            <button className={styles.swapInputButton}>
                                <img src={RubLogo}/>
                                RUB
                            </button>
                        </div>
                    </div>
                </div>
                <div className={styles.currencyPairItem}>
                    <h3>To</h3>
                    <div className={styles.swapInput}>
                        <div className={styles.swapInputLeft}>
                            <input ref={to} onInput={() => {
                                from.current.value = (to.current.value / 13.85).toFixed(2)
                            }}/>
                        </div>
                        <div className={styles.swapInputRight}>
                            <div className={styles.swapInputPlaceholder}>~RUB</div>
                            <button className={styles.swapInputButton}>
                                <img src={UsdtLogo}/>
                                USDT
                            </button>
                        </div>
                    </div>
                </div>
            </div>
            <div className={styles.aboutSwap}>
                <div className={styles.aboutSwapItem}>
                    <div className={styles.aboutSwapItemLeft}>
                        Цена:
                    </div>
                    <div className={styles.aboutSwapItemRight}>
                        13.85 RUB per 1 USDT
                    </div>
                </div>
                <div className={styles.aboutSwapItem}>
                    <div className={styles.aboutSwapItemLeft}>
                        Комиссия:
                    </div>
                    <div className={styles.aboutSwapItemRight}>
                        1%
                    </div>
                </div>
                <div className={styles.aboutSwapItem}>
                    <div className={styles.aboutSwapItemLeft}>
                        Route:
                    </div>
                    <div className={styles.aboutSwapItemRight}>
                        TON > USDT
                    </div>
                </div>
            </div>
            <ButtonComponent className={styles.swapButton}>Swap</ButtonComponent>
        </div>
    );
}

export default Swap;
